import { RiDeleteBin2Fill } from "react-icons/ri";
import Button from "./Button";

const Event = ({ eve, onDelete }) => {
  return (
    <div className="event">
      <div className="item">
        <h3> {eve.text} </h3>
        <button>Show More</button>
        {eve.registered ? <p color="green">You have successfully registered for this event</p> : <p color="red">Double click to register</p>}
      </div>
      <RiDeleteBin2Fill className="delete-btn" onClick={() => onDelete(eve.id)} />
    </div>
  );
};

export default Event;
